SET QUOTED_IDENTIFIER ON
GO
SET ANSI_NULLS ON
GO
CREATE PROC [dbo].[prs_tblFileSelect] 
@FieldName nvarchar(50),
@Value nvarchar(50),
@h int

AS 

	BEGIN TRAN
	if (@h=0) set @h=2147483647
	set @Value=dbo.fn_TextNormalize(@Value)

	if (@FieldName='fldId')
	begin
		if((select count(*) from [dbo].[tblFile] WHERE  fldId=@Value)>0)
		SELECT top(@h) [fldId], [fldFile], [fldPasvand], [fldDesc], [fldFileName], [fldSize] 
		FROM   [dbo].[tblFile] 
		WHERE  fldId=@Value
		else
		select 0 as fldId, as fldFile,'.jpg' as fldPasvand,'' as fldDesc,'' as fldFileName,0 as fldSize
	end

	if (@FieldName='fldDesc')
	SELECT top(@h) [fldId], [fldFile], [fldPasvand], [fldDesc], [fldFileName], [fldSize] 
	FROM   [dbo].[tblFile] 
	WHERE  fldDesc=@Value

	if (@FieldName='')
	SELECT top(@h) [fldId], [fldFile], [fldPasvand], [fldDesc], [fldFileName], [fldSize] 
	FROM   [dbo].[tblFile] 

	
	COMMIT
GO
